DO $$
DECLARE 
	USUARIO_ROOT		TEXT := 'root';
	EMAIL_ROOT			TEXT := 'tecabix@gmail.com';
	id_aux_1			bigint;
	id_aux_2			bigint;
	id_aux_3			bigint;
	id_aux_4			bigint;
	VAR_ACTIVO			bigint;
	VAR_USR_CREA		bigint;
	ADMINISTRADOR_ROOT	bigint;
	AUTENTIFICADOS 		bigint;
	item_aux        	RECORD;
BEGIN
	
	
	UPDATE tecabix_sce.usuario SET id_usuario_modificado = VAR_USR_CREA, id_estatus = VAR_ACTIVO;
	ALTER TABLE tecabix_sce.usuario ALTER COLUMN id_usuario_modificado SET NOT NULL;
	ALTER TABLE tecabix_sce.usuario ALTER COLUMN id_estatus SET NOT NULL;
	
	ALTER TABLE tecabix_sce.usuario ADD CONSTRAINT fk_usuario_id_estatus FOREIGN KEY (id_estatus)
	REFERENCES tecabix_sce.catalogo(id_catalogo) MATCH SIMPLE
	ON DELETE NO ACTION ON UPDATE NO ACTION NOT DEFERRABLE;

	ALTER TABLE tecabix_sce.usuario ADD CONSTRAINT fk_usuario_id_usuario_modificado FOREIGN KEY (id_usuario_modificado)
	REFERENCES tecabix_sce.usuario(id_usuario) MATCH SIMPLE
	ON DELETE NO ACTION ON UPDATE NO ACTION NOT DEFERRABLE;

	UPDATE tecabix_sce.catalogo_tipo SET id_usuario_modificado = VAR_USR_CREA,id_estatus = VAR_ACTIVO;
	ALTER TABLE tecabix_sce.catalogo_tipo ALTER COLUMN id_usuario_modificado SET NOT NULL;
	ALTER TABLE tecabix_sce.catalogo_tipo ALTER COLUMN id_estatus SET NOT NULL;

	ALTER TABLE tecabix_sce.catalogo_tipo ADD CONSTRAINT fk_catalogo_tipo_id_estatus FOREIGN KEY (id_estatus)
	REFERENCES tecabix_sce.catalogo(id_catalogo) MATCH SIMPLE
	ON DELETE NO ACTION ON UPDATE NO ACTION NOT DEFERRABLE;

	ALTER TABLE tecabix_sce.catalogo_tipo ADD CONSTRAINT fk_catalogo_tipo_id_usuario_modificado FOREIGN KEY (id_usuario_modificado)
	REFERENCES tecabix_sce.usuario(id_usuario) MATCH SIMPLE
	ON DELETE NO ACTION ON UPDATE NO ACTION NOT DEFERRABLE;

	UPDATE tecabix_sce.catalogo SET id_usuario_modificado = VAR_USR_CREA,id_estatus = VAR_ACTIVO;
	ALTER TABLE tecabix_sce.catalogo ALTER COLUMN id_usuario_modificado SET NOT NULL;
	ALTER TABLE tecabix_sce.catalogo ALTER COLUMN id_estatus SET NOT NULL;

	ALTER TABLE tecabix_sce.catalogo ADD CONSTRAINT fk_catalogo_id_estatus FOREIGN KEY (id_estatus)
	REFERENCES tecabix_sce.catalogo(id_catalogo) MATCH SIMPLE
	ON DELETE NO ACTION ON UPDATE NO ACTION NOT DEFERRABLE;

	ALTER TABLE tecabix_sce.catalogo ADD CONSTRAINT fk_catalogo_id_usuario_modificado FOREIGN KEY (id_usuario_modificado)
	REFERENCES tecabix_sce.usuario(id_usuario) MATCH SIMPLE
	ON DELETE NO ACTION ON UPDATE NO ACTION NOT DEFERRABLE;


	
	/**************************** PLAN Y SERVICIO ****************************/

	
	
	



	
	/**************************** CATALOGO ****************************/

	SELECT id_catalogo_tipo INTO id_aux_1 FROM tecabix_sce.catalogo_tipo WHERE nombre = 'TIPO_DE_PAGO';






	












		

	/**************************** AUTORIZACION ****************************/










	




	


			

		



	/**************************** BANCO ****************************/


	/**************************** ENTIDAD FEDERATIVA ****************************/


	/**************************** MUNICIPIOS ****************************/


	CREATE TRIGGER trg_catalogo_tipo_after_insert
    AFTER INSERT
    ON tecabix_sce.catalogo_tipo
    FOR EACH ROW
    EXECUTE PROCEDURE tecabix_sce.trg_catalogo_tipo_after_insert();

	CREATE TRIGGER trg_catalogo_after_insert
    AFTER INSERT
    ON tecabix_sce.catalogo
    FOR EACH ROW
    EXECUTE PROCEDURE tecabix_sce.trg_catalogo_after_insert();

	CREATE TRIGGER trg_catalogo_after_update
    AFTER UPDATE
    ON tecabix_sce.catalogo
    FOR EACH ROW
    EXECUTE PROCEDURE tecabix_sce.trg_catalogo_after_update();

	CREATE TRIGGER trg_usuario_after_insert
    AFTER INSERT
    ON tecabix_sce.usuario
    FOR EACH ROW
	EXECUTE PROCEDURE tecabix_sce.trg_usuario_after_insert();
	
	CREATE TRIGGER trg_usuario_after_update
    AFTER UPDATE
    ON tecabix_sce.usuario
    FOR EACH ROW
    EXECUTE PROCEDURE tecabix_sce.trg_usuario_after_update();

	CREATE TRIGGER trg_catalogo_tipo_after_update
    AFTER UPDATE
    ON tecabix_sce.catalogo_tipo
    FOR EACH ROW
    EXECUTE PROCEDURE tecabix_sce.trg_catalogo_tipo_after_update();

